import React from "react";

const RessetModal = () => {
  return (
    <div>
      <h1>Reset password</h1>
      <p className="message_modal_content">
        If this is a valid account, we will email your password reset
        instructions to tati@gmail.com.
      </p>
    </div>
  );
};

export default RessetModal;
